import React from "react";
import s from "../App.css";


function DisplayComponent(){
    return (
        <div className={s.main_section}>
            <div className={s.clock_holder}>
                <div className={s.stopwatch}>

                </div>
            </div>
        </div>
    );
}

export default DisplayComponent;
